import axios from 'axios';
import { useEffect, useState } from "react";

function Student()
{

//Logic

  const [user, setUsers] = useState([]);
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [id, setId] = useState('');



useEffect(() => {
  (async () => await Load())();
  }, []);


  async function  Load()
  {
     const result = await axios.get("http://localhost:8089/getall");
         setUsers(result.data);
         console.log(result.data);
  }



     async function save(event)
    {
        event.preventDefault();
    try
        {
         await axios.post("http://localhost:8089/save",
        {
          id:id,
        firstName: firstName,
        lastName: lastName,
        email: email,
        });
           alert('User saved successfully');
           setId('');
           setFirstName('');
           setLastName('');
           setEmail('');
           Load();
      }catch(err)
        {
          alert("User Registation Failed");
        }
   }







//Design

  return (
    <div>
       <h1>Student Details</h1>
       <div class="container mt-4" >
          <form>

              <div class="form-group">
                <label>Student Name</label>
                <input  type="text" class="form-control" id="firstName"
                value={firstName}
                onChange={(event) =>
                  {
                    setFirstName(event.target.value);      
                  }}
                />
              </div>
               <div><label for="classSelect">Select Class:</label>
    <select id="classSelect" onchange="showSelectedClass()">
        <option value="">Select a class</option>
        <option value="I">I</option>
        <option value="II">II</option>
        <option value="III">III</option>
        <option value="IV">IV</option>
        <option value="V">V</option>
        <option value="V1">V1</option>
        <option value="V11">V11</option>
        <option value="V111">V111</option>
        <option value="1X">1X</option>
        <option value="X">X</option>
        <option value="X11">X11</option>
        <option value="X12">X12</option>
    </select></div>
          <div><label for="dob">Date of Birth:</label>
    <input type="date"></input></div>
              <div class="form-group">
                <label>Student Address</label>
                <input  type="text" class="form-control" id="lastName" 
                 value={lastName}
                  onChange={(event) =>
                    {
                      setLastName(event.target.value);      
                    }}
                />
              </div>

              <div class="form-group">
                <label>Mobile</label>
                <input type="text" class="form-control" id="email" 
                  value={email}
                onChange={(event) =>
                  {
                    setEmail(event.target.value);      
                  }}
                />


              </div>
              <div>
              <button   class="btn btn-primary mt-4"  onClick={save}>Register</button>


              </div>   
            </form>
          </div>
                <br/>
<table class="table table-dark" align="center">
  <thead>
    <tr>
      <th scope="col">Student Name</th>
      <th scope="col">Student Address</th>
      <th scope="col">Student Mobile</th>

      <th scope="col">Option</th>
    </tr>
  </thead>
       {user.map(function fn(user)
       {
            return(
            <tbody>
                <tr>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{user.email}</td>
                <td>R00{user.id}</td>        
                <td>
                </td>
                </tr>
            </tbody>
            );
            })}
            </table>
       </div>
            );
        }

  export default Student;
